DROP TABLE IF EXISTS `donation`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `donation` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `campaign_id` bigint(20) unsigned NOT NULL,
  `permission_ID` bigint(20) unsigned NOT NULL,
  `fullname` varchar(512) NOT NULL,
  `amount_money` decimal(15,2) DEFAULT NULL,
  `amount_time` decimal(15,2) DEFAULT NULL,
  `donation_made_on` datetime DEFAULT NULL,
  `security_code` bigint(20) DEFAULT NULL,
  `session_id` varchar(50) DEFAULT NULL,
  `ip_address` varchar(255) DEFAULT NULL,
  `postal_code` varchar(45) DEFAULT NULL,
  `user_agent` varchar(250) DEFAULT NULL,
  `referer` text,
  `donation_channel_id` bigint(20) unsigned DEFAULT NULL,
  `status` varchar(25) DEFAULT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_created` bigint(11) DEFAULT NULL,
  `last_update_date` timestamp NULL DEFAULT NULL,
  `last_user_update` bigint(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `donation_permission_id_idx` (`permission_ID`),
  KEY `donation_campaign_id_idx` (`campaign_id`),
  KEY `fk_donation_channel_id` (`donation_channel_id`),
  CONSTRAINT `fk_donation_campaign_id` FOREIGN KEY (`campaign_id`) REFERENCES `campaign` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_donation_channel_id` FOREIGN KEY (`donation_channel_id`) REFERENCES `donation_channel` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_donation_permission_id` FOREIGN KEY (`permission_ID`) REFERENCES `permission` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1772 DEFAULT CHARSET=utf8;
