CREATE TABLE `entity` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(512) NOT NULL,
  `entity_type_id` bigint(20) NOT NULL,
  `ein` varchar(45) DEFAULT NULL,
  `parent_entity_id` bigint(20) unsigned DEFAULT NULL,
  `url` varchar(512) DEFAULT NULL,
  `logo_filename` varchar(512) DEFAULT NULL,
  `street` varchar(512) DEFAULT NULL,
  `city` varchar(512) DEFAULT NULL,
  `state` varchar(45) DEFAULT NULL,
  `zip` varchar(45) DEFAULT NULL,
  `budget_id` bigint(20) DEFAULT NULL,
  `group_examptmt_num` varchar(45) DEFAULT NULL,
  `subsection_code` varchar(45) DEFAULT NULL,
  `affiliation_code` varchar(45) DEFAULT NULL,
  `classification_code` varchar(45) DEFAULT NULL,
  `rule_date` varchar(45) DEFAULT NULL,
  `deductibility_code` varchar(45) DEFAULT NULL,
  `foundation_code` varchar(45) DEFAULT NULL,
  `activity_codes` varchar(45) DEFAULT NULL,
  `organization_codes` varchar(45) DEFAULT NULL,
  `exampt_status_code` varchar(45) DEFAULT NULL,
  `tax_period` varchar(45) DEFAULT NULL,
  `asset_code` varchar(45) DEFAULT NULL,
  `income_code` varchar(45) DEFAULT NULL,
  `filing_req_code` varchar(45) DEFAULT NULL,
  `pff_filing_req_code` varchar(45) DEFAULT NULL,
