  `user_created` bigint(11) DEFAULT NULL,
  `last_update_date` timestamp NULL DEFAULT NULL,
  `last_user_update` bigint(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `ein_UNIQUE` (`ein`),
  KEY `entity_entity_type_id_idx` (`entity_type_id`),
  KEY `entity_budget_id_idx` (`budget_id`),
  KEY `entity_parent_entity_id_idx` (`parent_entity_id`),
  CONSTRAINT `fk_entity_budget_id` FOREIGN KEY (`budget_id`) REFERENCES `budget` (`id`),
  CONSTRAINT `fk_entity_entity_type_id` FOREIGN KEY (`entity_type_id`) REFERENCES `entity_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_entity_parent_entity_id` FOREIGN KEY (`parent_entity_id`) REFERENCES `entity` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1092 DEFAULT CHARSET=utf8;
