DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL,
  `version` bigint(20) DEFAULT NULL,
  `account_expired` bit(1) NOT NULL,
  `account_locked` bit(1) NOT NULL,
  `enabled` bit(1) NOT NULL,
  `password` varchar(255) NOT NULL,
  `password_expired` bit(1) NOT NULL,
  `first_name` varchar(255) NOT NULL,
  `last_name` varchar(255) NOT NULL,
  `account_id` bigint(20) unsigned NOT NULL,
  `deleted` bit(1) NOT NULL,
  `title` varchar(255) DEFAULT NULL,
  `status` varchar(25) DEFAULT NULL,
  `phone` varchar(25) DEFAULT NULL,
  `orgName` varchar(255) DEFAULT NULL,
  `orgType` varchar(45) DEFAULT NULL,
  `orgBudget` varchar(45) DEFAULT NULL,
  `stripe_id` varchar(255) DEFAULT NULL,
  `reset_token` varchar(255) DEFAULT NULL,
  `reset_token_date` datetime DEFAULT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `user_created` bigint(11) DEFAULT NULL,
  `last_update_date` timestamp NULL DEFAULT NULL,
  `last_user_update` bigint(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  KEY `account_account_id_idx` (`account_id`),
  CONSTRAINT `fk_user_account_id` FOREIGN KEY (`account_id`) REFERENCES `account` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1056 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;
