CREATE DEFINER=`posiba`@`%` PROCEDURE `donor_entity_donate`(
 p_donor_id BIGINT 
)
BEGIN
 drop temporary table if exists donate_temp;
 create temporary table if not exists donate_temp as (
  select e.id entity_id,
   e.name entity_name, 
   d.id donation_id,
   d.campaign_id,
   d.donation_made_on,
   d.amount_money,
   d.amount_time,
            d.created_date
  from donation d
   join campaign c on d.campaign_id = c.id
   join entity e on c.entity_id = e.id
  where exists (
    select 1
    from visitor_donation_map vd
     join donor_visitor_map dv on vd.visitor_id = dv.visitor_id
    where dv.individual_donor_id = p_donor_id and vd.donation_id = d.id
  )
 );
 
 -- mysql doesn't allow union inside create temp table query
 insert into donate_temp
  select entity_id,
   entity_name,
   0,
   ~0,
   donation_made_on,
   money amount_money,
   time amount_time,
            created_date
  from donor_entity_donate_map
  where individual_donor_id = p_donor_id
   and status = 'ACTIVE';

 select max(entity_id) entity_id,
  entity_name,
  max(donation_id) donation_id,
  (case min(campaign_id) when ~0 then 0 else min(campaign_id) end) campaign_id,
  max(donation_made_on) donation_made_on,
  sum(amount_money) sum_amount_money,
  sum(amount_time) sum_amount_time,
        (case when max(entity_id) > 0 then 1 else 0 end) verified,
        max(donation_id) min_donation_id, -- bypass min donation id (ensure same data structure with sp donor_entity_donate_detail)
        0 total, -- bypass total rows (ensure same data structure with sp donor_entity_donate_detail)
        max(created_date) created_date
 from donate_temp
 group by entity_name
 order by donation_made_on desc, created_date desc;

 drop temporary table donate_temp;
END ;;
