CREATE DEFINER=`posiba`@`%` PROCEDURE `donor_entity_donate_detail`(
	p_donor_id BIGINT,
	p_entity_name VARCHAR(100),
	p_order_by VARCHAR(100),
	p_limit_skip INT,
	p_limit_next INT
)
BEGIN    
    drop temporary table if exists donate_detail_temp;
	create temporary table if not exists donate_detail_temp as (
		select e.id entity_id, 
			e.name entity_name,
			d.id donation_id,            
			d.campaign_id,
			d.donation_made_on donate_date,
			d.amount_money,
			d.amount_time,
			1 verified,
            d.id min_donation_id
		from donation d
			join campaign c on d.campaign_id = c.id
			join entity e on c.entity_id = e.id
		where e.name = p_entity_name
			and exists (
				select 1
				from visitor_donation_map vd
					join donor_visitor_map dv on vd.visitor_id = dv.visitor_id
				where dv.individual_donor_id = p_donor_id and vd.donation_id = d.id
		)
	);
    
    -- mysql doesn't allow union inside create temp table query
	insert into donate_detail_temp
		select entity_id,
			entity_name,
			id donation_id,					
            (select ifnull(min(id),0) from campaign where entity_id = m.entity_id) campaign_id,
			donation_made_on donate_date,
			money amount_money,
			time amount_time,
            0 verified,
            (select ifnull(min(d.id),0) from donation d join campaign c on d.campaign_id = c.id where c.entity_id = m.entity_id) min_donation_id
		from donor_entity_donate_map m
		where entity_name = p_entity_name
			and individual_donor_id = p_donor_id
			and status = 'ACTIVE';
    
    set @total = (select count(*) from donate_detail_temp);
    
    set @sql = concat('
	select *, ', @total, ' total
	from donate_detail_temp
	order by ', p_order_by, '
	limit ?,?');
	
	prepare stmt from @sql;

	set @p_limit_skip = p_limit_skip;
	set @p_limit_next = p_limit_next;

	execute stmt using @p_limit_skip, @p_limit_next;

	deallocate prepare stmt;
    drop temporary table donate_detail_temp;
END ;;
