CREATE DEFINER=`posiba`@`%` PROCEDURE `entity_name_isexisted`(
	p_donor_id BIGINT,
	p_entity_name_test VARCHAR(100)
)
BEGIN
	declare test1 bit;
	declare test2 bit;

	if exists(
		select 1		
		from entity e
		where e.name = p_entity_name_test 
			and exists (
					select 1
					from donation d
						join campaign c on d.campaign_id = c.id
						join visitor_donation_map vd on d.id = vd.donation_id
						join donor_visitor_map dv on vd.visitor_id = dv.visitor_id
					where dv.individual_donor_id = p_donor_id and c.entity_id = e.id
			)
	) then	
		select 1;	
	elseif exists(
		select 1		
