/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
CREATE DEFINER=`posiba`@`%` PROCEDURE `user_donate_history`(
    p_user_id bigint,
	p_start_date datetime,
	p_end_date datetime,
	p_is_find_all bit
)
BEGIN	
	DECLARE csum_money DECIMAL(15,2) DEFAULT 0;
	DECLARE csum_time DECIMAL(15,2) DEFAULT 0;

	SET @csum_money := 0;
	SET @csum_time := 0;
	
	select *
	from (
		select *,
			(@csum_money := @csum_money + IFNULL(amount_money,0)) AS cumulative_sum_money,
			(@csum_time := @csum_time + IFNULL(amount_time, 0)) AS cumulative_sum_time
		from (
			select donate_date,
				sum(amount_money) amount_money,
				sum(amount_time) amount_time,
				entity_name
			from (
				select 
					date(donation_made_on) donate_date,
					amount_money, 
					amount_time,
					(select e.name
						from entity e 
							join campaign c on e.id = c.entity_id
						where c.id = d.campaign_id) entity_name
				from donation d
				where exists (
					select 1 
					from visitor_donation_map vd
						join donor_visitor_map dv on dv.visitor_id = vd.visitor_id
					where vd.donation_id = d.id and dv.individual_donor_id = p_user_id
				)
				union all
				select 
					date(donation_made_on) donate_date,
					money amount_money,
					time amount_time,
					entity_name
				from donor_entity_donate_map
				where individual_donor_id = p_user_id 
					and status = 'ACTIVE'
			) t1
			group by donate_date, entity_name
			order by donate_date, amount_money desc, entity_name
		) t2
	) t3
	where p_is_find_all = 1 OR DATE(donate_date) BETWEEN DATE(p_start_date) AND DATE(p_end_date);
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `user_entity_donate_history` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = '' */ ;
DELIMITER ;;
CREATE DEFINER=`posiba`@`%` PROCEDURE `user_entity_donate_history`(
    p_user_id bigint
)
BEGIN
	SELECT * 
	FROM (
		SELECT e.id entityId, 
			e.name entityName, 
			e.url entityUrl, 
			e.logo_filename entityLogoFileName, 
			IFNULL((SELECT sum(amount_money) 
				FROM donation d1
				WHERE EXISTS (
					SELECT 1
					FROM donation d
					JOIN campaign c on d.campaign_id = c.id			
					JOIN visitor_donation_map vd on vd.donation_id = d.id
					JOIN donor_visitor_map dv on dv.visitor_id = vd.visitor_id
				WHERE dv.individual_donor_id = p_user_id AND c.entity_id = e.id AND d1.id = d.id)), 0) amount_money,
			IFNULL((SELECT sum(amount_time) 
				FROM donation d1
				WHERE EXISTS (
					SELECT 1
					FROM donation d
					JOIN campaign c on d.campaign_id = c.id			
					JOIN visitor_donation_map vd on vd.donation_id = d.id
					JOIN donor_visitor_map dv on dv.visitor_id = vd.visitor_id
				WHERE dv.individual_donor_id = p_user_id AND c.entity_id = e.id AND d1.id = d.id)), 0) amount_time,
			(SELECT max(donation_made_on)
				FROM donation d1
				WHERE EXISTS (
					SELECT 1
					FROM donation d
					JOIN campaign c on d.campaign_id = c.id			
					JOIN visitor_donation_map vd on vd.donation_id = d.id
					JOIN donor_visitor_map dv on dv.visitor_id = vd.visitor_id
				WHERE dv.individual_donor_id = p_user_id AND c.entity_id = e.id AND d1.id = d.id)) donation_made_on
		FROM entity e) t
	WHERE donation_made_on is not null
	ORDER BY t.entityName ASC;    
END ;;
DELIMITER ;
